        artworks.add(new Art("107","Ayres Rock and the Olgas","61/563/IR_4533.0231","Watercolour paintings","1990","Wagga Wagga, New South Wales, Australia","Daniel Goodwin","A watercolour painting on board featuring a landscape lined with green trees, Uluru in the background and round boulders on the right. The painting is signed in the e bottom right corner 'D GOODWIN 90 / AYRS ROCK & MT OLGAS'. On the reverse is a silver ATSIC sticker some of which reads 'Asset No: N- 0080' The painting is under glass with cream mat and gold wooden frame.\n"));
        artworks.add(new Art("108","Water Lilies","61/269/IR_4532.0323","Watercolour paintings","1990","Brisbane, Queensland, Australia","Harold Joesph Thomas","A colour watercolour painting on paper featuring trees reflected in water which has a bird, waterlily pads and flowers on its surface. It has a removable black plaque which features the title, artist and information on the painting. On the reverse is the handwritten text 'C-0685', a framer's stamp, and the number '7858 HTH'. There is also a bar code with the number 'F0008575'. The work is under glass, and has a gold timber frame. It is on a white and brown matt.\n"));
        artworks.add(new Art("109","Burning Up","60/706/IR_4530.0181","Paintings","1990","Canberra, Australian Capital Territory, Australia","Judy Watson","A painting on canvas by Judy Watson titled 'Burning Up'. The painting features a flame-like design in red and white on a black background, flanked with film strip-like panels in black, white and yellow on either side. On the reverse side of the canvas words are handwritten 'Judy Watson / \"burning up\" / Completed Oct. 1990. / C/- 64 Agnes St. / Acacia Ridge Q. 4110. / Brisbane. 07-2770917'. There is also a silver sticker printed in blue: 'ABORIGINAL AND TORRES STRAIT / ISLANDER COMMISSION / Asset No: C-0507 / ATSIC' and handwritten in black: 'ASSET NO: C-0507'. The top and bottom of the canvas is studded with brass eyelets.\n"));
        artworks.add(new Art("110","Dot Painting","60/591/IR_4530.0067","Paintings","1990","Alice Springs, Norther Territory, Australia","Dorothy Napangardi","A dot painting on black canvas featuring a series of white dot lines that resemble cracks. The cracks appear like markings on a surface of light brown dots. On the reverse is text \"Dorothy Napangardi / DN 2748A / Gallery Gondwana\" handwritten in black ink. The canvas is stretched over a wooden stretcher and stapled to the back.\n"));
        artworks.add(new Art("111","Jungedey","60/374/IR_4529.0079","Paintings","1990","Wagga Wagga, New South Wales, Australia","Max Conlon","A painting on canvas, featuring in the centre is a rectangular shape and is surrounded by white dots containing nine black figures. Surrounding them is seventeen circles, surrounded by leaf patterns which is surrounded by eight more black figures which are surrounded by black footprints. Around the border is a snake, echidna, lizard, emu and a kangaroo. The painting is signed on the right side.\n"));
        artworks.add(new Art("112","Mundagudda","60/373/IR_4529.0078","Paintings","1990","Wagga Wagga, New South Wales, Australia","Max Conlon","A painting on board featuring two figures around a concentric circle in the middle with six figures standing around the circle. There is dot design in the background with leaf patterns at the top and bottom surrounded by a white dot boarder. The painting is signed 'MCONION 11.90 / MUNDAGUDDA'. The painting is framed in a wooden frame.\n"));
        artworks.add(new Art("113","Storm Dreaming, Mount Wedge Station","60/371/IR_4529.0076","Paintings","1990","Canberra, Australian Capital Territory, Australia","Kitty Napaltjarri","A dot painting on canvas featuring a central concentric circle with black zigzag lines from the middle to the corners. There are four patches of oval shape dots and black symbolic designs. On the reverse is hand written text some of which reads 'Kitty Pultara Storm Dreaming - Mt Wedge Station / C-0289'. There are also three stickers on the back. The painting has a backing board and is framed in a wooden frame.\n"));
        artworks.add(new Art("114","Crocodile, turtle, fish and seal","61/559/IR_4533.0226","Acrylic paintings","1991","Mount Isa, Queensland, Australia","Duncan Roughsey","A colour dot painting on board featuring a central crocodile with a turtle, fish and seal like creature on a yellow background with white dots. The painting is signed at the bottom 'DUNCAN.RougHsey 91/'.\n"));
        artworks.add(new Art("115","Torres Strait Mask","61/267/IR_4532.0321","Paintings","1991","Cairns, Queensland, Australia","Joesph Dorante","A brown painting on paper featuring a mask with large eyes, an elongated nose and elongated ears in predominantly browns, whites and blacks. Behind the mask are weapons featuring patterns and a turtle. The painting also features white paint spatters.\n"));
        artworks.add(new Art("116","Dot Painting","61/206/IR_4532.0259","Paintings","1991","Mount Isa, Queensland, Australia","Ronald Eatts","A colour dot painting on board featuring a central column with a grey wavy line running vertically down the middle with brown plus shapes on the right and brown semi circles on the left. The column has a outline on either side by red vertical sections with grey, white and black dot markings. In each corner is a brown spirit figure. On the bottom left corner is the artists signature 'R.Eatts'. On the reverse handwritten in black ink is the number '43094010'. The painting has a brown wooden frame with gold trim.\n"));
        artworks.add(new Art("117","Dot painting featuring five figures","61/154/IR_4532.0206","Paintings","1991","Mount Isa, Queensland, Australia","Ronald Eatts","A colour painting on board featuring five figures and segments of a vine. The painting is divided into two sections by a vertical black curved line. To the left is a black figure, to the right are three white figures and one yellow figure. The figures have long curled nails. The left side is patterned by black circles outlined in yellow and depicts several limb like shape with long nails. The background is red with brown dots. The right side has three vine like branches amongst the figures. The background is brown with yellow and white dots. Centred at the bottom is a signature 'R. Eatts / 91'. On the reverse in black ink is the number '43094026' and a yellow sticker from 'BRUSH & PALETTE / PICTURE FRAMING'. The painting has a brown wooden frame with black and gold painted edging.\n"));
        artworks.add(new Art("118","Lizard and turtle like creature","61/150/IR_4532.0202","Bark paintings","1991","Mount Isa, Queensland, Australia","Duncan Roughsey","A painting on board featuring a lizard at the bottom and a turtle like creature with four black lines coming out of either side of its head at the top. They are surrounded by coloured circles of red, grey and black and the background is filled with white dots. There is a striped boarder in red, yellow and grey. On the back is a yellow sticker and had written number '43094015'. The painting is mounted to white canvas board and framed in wooden frame with gold inner edges.\n"));
        artworks.add(new Art("119","Two snakes and four fish","61/137/IR_4532.0189","Paintings","1991","Mount Isa, Queensland, Australia","Duncan Roughsey","A painting on board featuring two snakes crossed and four fish in the triangular areas created by the snakes. They are on a yellow background with white dots. There are also larger coloured dots in red, black grey and white. The boarder is detailed in red, yellow, grey and white stripes. The painting is signed at the bottom '91 DUNCAN.RougHsey'. On the back is a yellow sticker and the painting is attached to a white canvas board and framed in wooden frame with gold edges.\n"));
        artworks.add(new Art("120","Seven figures with dots and moon shapes","61/117/IR_4532.0169","Paintings","1991","Mount Isa, Queensland, Australia","Ronald Eatts","A painting on canvas board featuring seven figures. There is a central female figure with two blue lines containing concentric circles painted in white dots. The four black figures on the left are surrounded by half moons and yellow and white circles containing black dots. There are also two black figures in the bottom right corner. On the reverse is a yellow sticker and a hand written number '43094018'.\n"));
        artworks.add(new Art("121","Dot painting featuring nine brown figures","61/116/IR_4532.0168","Paintings","1991","Mount Isa, Queensland, Australia","Ronald Eatts","A colour dot painting on board featuring nine brown figures with long fingers. Five of the figures are centred in a horizontal line, with the middle figure larger than the rest. A figure appears horizontally in each of the corners. Two bands of light brown vine like branches bordered by blue lines separate the horizontal figures from the vertical ones. The background is light brown with dark brown and white dots. The signature 'R. Eatts 91' appears at the bottom to the left of centre. On the reverse is handwritten in black ink the number '43094001' and a yellow sticker from 'BRUSH & PALETTE / PICTURE FRAMING'. The painting has a brown wooden frame with black and gold painted edging.\n"));
        artworks.add(new Art("122","Paintings of five fish a figure and bush fruits","61/115/IR_4532.0167","Paintings","1991","Mount Isa, Queensland, Australia","Ronald Eatts","A dot painting on canvas board featuring five fish in the lower half, a figure on the upper right, bush fruits on upper left and dots painted in the middle top. There are also eight circles painted with white dots joined with double white dot lines. The painting is on a brown background with brown, yellow, and white dots. On the reverse is a yellow sticker and a hand written number '43094019'. The painting is framed in a wooden frame.\n"));
        artworks.add(new Art("123","Kurlama Spears and Jilamara","60/285/IR_4528.0292","Acrylic paintings","1991","Canberra, Australian Capital Territory, Australia","Maria Josette Orsto","A colour painting on canvas featuring a circle and three arrow like shapes. The circle is segmented into four quadrants and has a boarder patterned with squares. The painting has a black background. Attached to the bottom of the canvas with velcro is a black label with white text 'Kurlama Spears and Jilamara / Maria Josette Orsto b1962 / ...'. On the reverse handwritten in black text is 'C-0566 / $1200.00 1991 / FRAME 155 / Maria Josette Orsto'. Also on reverse is a silver sticker from the 'ABORIGINAL AND TORRES STRAIT / ISLANDER COMMISSION' with the ATSIC asset number 'C-0564'. The canvas is stretched over a strainer and has a black wooden frame.\n"));
        artworks.add(new Art("124","Painting of crocodile and three figures","60/255/IR_4528.0262","Paintings","1991","Adelaide, South Australia","Tony Gamarrow","A colour painting on paper featuring a crocodile and three human like figures. The crocodile is positioned vertically on it's head with the three figures surrounding him. One of the figures is positioned lying at the bottom of the painting near the crocodiles open mouth. The crocodile and the figures are yellow, patterned by white and brown line hatchings. The background is brown with white objects, including feathers, spears and clubs.\n"));
        artworks.add(new Art("125","Janganpa (Possum) Story","59/835/IR_4527.0009","Acrylic paintings","1991","Canberra, Australian Capital Territory, Australia","Johnny Possum Tjapaltjarri","A colour painting on canvas featuring a concentric circle in the centre with yellow, grey and orange lines and brown symbolic patterns on top. There are also grey and red lines. On the reverse is an ATSIC sticker that reads 'C-6290' and hand written text that reads ' ... / Frame 431'. The canvas is framed in a wooden frame with a white backing board.\n"));
        artworks.add(new Art("126","Dot painting", "61/854/IR_4534.0092","Acrylic paintings","1992","Canberra, Australian Capital Territory, Australia","Dale Huddleston","A colour painting on canvas featuring a central concentric circle surrounded by boomerangs and six thick green lines. The painting is signed in the bottom right corner 'DALE HUDDLESTON / 92'. On the reverse is handwritten text that reads 'PA608 / ?' and a white sticker. The canvas is stapled to a wooden strainer and has a red wooden frame.\n"));
        artworks.add(new Art("127","Watercolour painting of clubs and a carved head","61/845/IR_4534.0083","Watercolour paintings","1992","Canberra, Australian Capital Territory, Australia","Joseph Dorante","A watercolour painting on paper featuring a mottled background, four carved clubs and a carved stylised human head.\n"));
        artworks.add(new Art("128","Purlpurlpungka","61/783/IR_4534.0010","Acrylic paintings","1992","Kalgoorlie, Western Australia, Australia","Joy McArthur","A colour painting on canvas featuring a snake and two lizard. There is also a circle with symbolic designs on a background of pink, brown, yellow and orange dot patches. On the reverse is handwritten text \"JOY MCARTHUR / PURLPURLPUNGKU / 1992\". The painting is attached to a wooden strainer with velcro.\n"));
        artworks.add(new Art("129","A bark painting with two squids and three fish","61/047/IR_4531.0329","Bark paintings","1952","Coffs Harbour, New South Wales, Australia","Djambalula","A coloured bark painting featuring two squid like creatures surrounded by three fish. The bark is pigmented brown with black, yellow and white line and dot details. There is a border pigmented black and yellow with black, yellow and white dots. On the reverse is a sticker with the number '52' a deteriorated piece of paper and handwritten text that reads 'gambalula / ...'.\n"));
        artworks.add(new Art("130","Waterlilies, File snakes, Spiders and Water Insects","60/515/IR_4529.0212","Bark paintings","1965","Canberra, Australian Capital Territory, Australia","Unknown","A colour painting on bark featuring waterlilies, file snakes, spiders and water insects on a brown background with white, brown and light brown cross hatching. Some white pigment has flaked off creating a purple tinge. The words \"BUSH/TUCKER\" appear on the reverse in black marker.\n"));
        artworks.add(new Art("131","Bark painting of a squid and two fish","61/045/IR_4531.0327","Bark paintings","1957","Coffs Harbour, New South Wales, Australia","Djambalula","A coloured bark painting featuring a squid and two fish, which are painted with white or pink lines and with black and yellow dots on a brown background. On the reverse of the painting is a sticker with the number '57'. There is a large crack running the length of the bark.\n"));
