        artworks.add(new Art("133","Bark painting of three turtles and three fish","61/046/IR_4531.0328","Bark paintings","1962","Coffs Harbour, New South Wales, Australia","Djambalula","A coloured bark painting featuring three turtles pigmented with black lines and white, yellow and black dots. There are also two fish with white lines and a yellow fish like creature with white and black dots. The background is pigmented brown with yellow line border. On the reverse is a sticker with the number '62' and a deteriorated piece of paper with information.\n"));
        artworks.add(new Art("134","Namarodo Spirit","61/822/IR_4534.0059","Bark paintings","1985","Canberra, Australian Capital Territory, Australia","Marrainmol","A colour painting on bark featuring a male figure with brown and white cross hatch markings.The figure is standing to the left. There are four wood blocks on the reverse of the bark. There are a number of codes handwritten on the back which read \"DAA 850\" and \"MARRAINMOL / MIELLI TRIBE / ESTERN [sic] ARNHEM / LAND\".\n"));
        artworks.add(new Art("135","Man with Shield","61/144/IR_4532.0196","Paintings","1970","Canberra, Australian Capital Territory, Australia","Harold J. Thomas","An oil painting on canvas of an indigenous man with an orange object with white stripes under his arm. The man is facing to the left and has a light blue painted background and is signed in the bottom left corner 'HAROLD THOMAS / MARCH \"70\"'. On the back there is hand written text on the wooden stretcher that reads 'DAA 10001 (7788)'. The painting is framed in a wooden frame painted gold.\n"));
        artworks.add(new Art("136","Portrait of an Aboriginal woman","61/832/IR_4534.0070","Paintings","1972","Canberra, Australian Capital Territory, Australia","Unknown","A colour painting on board featuring the portrait of a woman wearing a green shirt and beige brimmed hat. The paint is signed in the bottom left corner.\n"));
        artworks.add(new Art("137","Possums at Ngamarunya","61/844/IR_4534.0082","Paintings","1973","Canberra, Australian Capital Territory, Australia","Long Jack Phillipus Tjakamarra","A colour dot painting on masonite. The panting, divided into six distinct sections by varying coloured dots and the presence of circular and linear patterns. The reverse of the painting features a sheet of white paper adhered to the surface, which bears information pertaining to the painting and the artist. Handwritten on the back of the painting is 'FRAME 412 / C-6294'. The painting is mounted on a second sheet of masonite, covered with a coarse textile and housed within a timber frame.\n"));
        artworks.add(new Art("138","Landscape 22 Alice Springs","61/986/IR_4534.0225","Paintings","1975","Canberra, Australian Capital Territory, Australia","Laurie Bray","An oil painting on canvas board of a landscape featuring two red cliffs with a body of water in between and a gum tree with three trunks on the left. The painting is signed \"LAURIE BRAY\". On the reverse is handwritten text that reads \"DAA 22/2 / DAA(T) / FRAME 410 / P.A. 693\". There are also two stickers one reads \"ATSIC Art 17\" and the other reads LANDSCAPE 22 / ALICE SPRINGS /1975 / ARTIST: LAURIE BRAY\". The painting is framed in a wooden frame. There is a sticker on the bottom left of the frame that reads \"A00693\".\n"));
        artworks.add(new Art("139","Organ Pipes Finke River NT","61/884/IR_4534.0122","Paintings","1975","Canberra, Australian Capital Territory, Australia","Laurie Bray","A colour landscape oil painting on canvas board featuring a jagged rocky outcrop. On the bottom right corner is a signature 'LAURIE BRAY'. On the reverse handwritten in black ink is 'DAA / 10020 / 7.7:88' and in blue pen 'LAWRENCE BRAY / ORGAN PIPES FINKE RIVER N.T.'. Attached to the reverse with blue tack is an orange label with white text 'Artist: Laurie Bray (deceased) / ... / DAA Collection / ...'\n"));
        artworks.add(new Art("140","Bark painting depicting a stingray","61/791/IR_4534.0018","Bark paintings","1975","Canberra, Australian Capital Territory, Australia","Bob Murdubul","A painting on bark which features a stingray. The stingray has a white, black and brown cross hatch pattern on its back and white dots elsewhere. The reverse of the bark has a sheet of paper stuck to it that has the title of the painting and the artists name along with other information. There is also 'P.A.69-' in black marker on the back of the bark.\n"));
        artworks.add(new Art("141","Eagle Waiting to Kill Kangaroo", "61/226/IR_4532.0279","Bark paintings","1975","Canberra, Australian Capital Territory, Australia","David Blanasi","A painting on bark featuring an eagle. The eagle is outlined in black with a white and yellow dot pattern. The inside of the wings and the body of the eagle have a cross hatched pattern. The background consists of a similar cross hatch design and is borderd by black lines with white and yellow dots. Wooden sticks are attached to the top and bottom of the bark with string. There is a paper label on the back of the bark with text reading \"ABORIGINAL ARTS & CRAFTS PTY. LIMITED / ... / Title Eagle Waiting to Kill Kangaroo / Artist David Blanasi\".\n"));
        artworks.add(new Art("142","Dot painting of three vertical concentric circles joined by wavy black lines","60/317/IR_4529.0022","Paintings","1975","Sydney, New South Wales, Australia","Charlie T. Tjungurrayi","A colour dot painting on canvas board featuring three black concentric circles. The circles run vertically down the middle of the canvas and are joined by two straight black lines. Black wavy lines run from circle to circle on a yellow background of white, black and grey dots. On the reverse is a silver sticker with the ATSIC asset number 'N- 0544' and written in pencil 'AA 78 59 94 / CT 75635 / PT 30G111 / Charlie Taurassi Tangahai / 1975' and in black ink '* N0544'. The painting is mounted to a canvas board, is under glass and has a brown wooden frame.\n"));
        artworks.add(new Art("143","Bark Painting-Lumaluma","61/818/IR_4534.0055","Bark paintings","1976","Canberra, Australian Capital Territory, Australia","Unknown","A colour painting on bark featuring a figure with line and cross hatch design on a brown background. On the reverse of the bark is tape with handwritten text \"47 / 10047\". as well as the number \"87\" and \"[U2NS?]\" in black marker and a chalk \"7\". There is also a white patch of paint with the code \"AAB/78/7837 / 76/880/010.\" On the reverse if the casing is hand written text that reads \"DAA 10047\". There is also masking tape with the numbers \"100 / 47 / 10042 / J\" written on it.\n"));
        artworks.add(new Art("144","Bark painting depicting part of Wagilag Sisters Myth","61/233/IR_4532.0286","Bark paintings","1976","Canberra, Australian Capital Territory, Australia","Unknown","A painting on bark featuring four female figures circled by a snake. There are four goannas on the outside of the snake. The painting consists of a cross hatched design of yellow, white and brown line markings. On the reverse handwritten in black ink is the text \"Artist: [...?] / ... / Location: Maningrida / a portion of the myth of / the Wawiluk sisters...\" and the number \"10041\". Also on the reverse in a white rectangle is black text \"AAB-78-8099 / 76/880/019\".\n"));
        artworks.add(new Art("145","Framed set of twelve tiles","59/928/IR_4527.0087","Tiles","1976","Canberra, Australian Capital Territory, Australia","Thancoupie","A framed set of twelve square tiles. The tiles are made from clay and positioned in a 3 x 4 pattern to form a rectangle. The middle columns are darker in colour and have raised etchings. The tiles on the sides have raised circular features. The tiles are attached to a backing board with a black matt and black wooden frame. On the back of the backing board \"C-0323 / FRAME: 134\".\n"));
        artworks.add(new Art("146","Painting of landscape","61/987/IR_4534.0226","Paintings","1977","Canberra, Australian Capital Territory, Australia","Basil Rantji","A watercolour landscape painting on board featuring two trees on the right side with red rocks beneath them. There are green trees in the middle ground with mountains in the background that fade from red on the right to blue on the left. The painting is signed at the bottom right 'BASEL RAntji'. On the reverse is handwritten text that reads 'DAA 903 / 18.3.75'.\n"));
        artworks.add(new Art("147","Shark","60/268/IR_4528.0275","Bark paintings","1977","Sydney, New South Wales, Australia","Maw Mununggurr","A painting on bark featuring a black shark in a vertical position against a white and brown cross hatch background. The cross hatched design is separated by black lines. On the reverse handwritten in black ink is \"93 / 77/880/006 / AAB/78/7007 / 10042\".\n"));
        artworks.add(new Art("148","Lightning Snakes","60/266/IR_4528.0273","Bark paintings","1977","Sydney, New South Wales, Australia","Wakuthi Marawili","A colour painting on bark featuring a pair of snakes, birds, fish and a four legged animals. The snakes are positioned vertically facing each other down the centre of the painting. One snake is brown and the other black. Both snakes have white line markings. The rest of the animals are positioned on either side of the snakes in horizontal cross hatch segments. The four legged animals are in the top segment, are black with white line markings and positioned upside down and facing each other. The fish are in the middle, are black with white line markings, are upside down and facing each other. The birds are in the bottom segment, are black with white line markings and facing each other. There is writing in black marker on the reverse that reads \"94 10040\". There is also writing in a small white patch that reads \"AAB/78/7065 / 77/880/906\".\n"));
        artworks.add(new Art("149","Bark painting depicting a rock wallaby and two figures","62/010/IR_4534.0249","Bark paintings","1978","Canberra, Australian Capital Territory, Australia","Unknown","A colour painting on bark featuring a kangaroo and two brown figures one has white lines on a black background. On the reverse of the bark itself is the number \"AAB/78/6381\".\n"));
        artworks.add(new Art("150","Barrunindi","61/817/IR_4534.0054","Bark paintings","1978","Canberra, Australian Capital Territory, Australia","Jimmy N. Nganjmirra","A painting on bark featuring two different sized fish. The larger fish has a spear in it's back. The fish are patterned with white and brown cross hatch markings. Wooden sticks have been attached to the top and bottom of the bark with string. On the reverse handwritten in black ink is \"B258\" and \"10067\". Also on the reverse is a white rectangle with black text \"AAB/78/6828\". There is also the 84 in black marker on the bark.\n"));
